window.bookSummaryJSON = "<p>Love that says something, instead of just looking like it.</p> <p>Love you can always trust to feel like home.</p> <p>For both of them, it’s something that has always been just outside of their peripheral, something to be observed rather than experienced. A depth of feeling reserved for people who were “into” that, those with a different outlook, those more...deserving.</p> <p>Until their paths cross.</p> <p>Lines are crossed.</p> <p>And maybe the stars are crossed too, because the connection and chemistry are so off the charts that they can’t stay away from each other, can’t avoid it...even if they think they should.</p>"; 
